import React from 'react';
import {Grid, Typography, FormControl, InputLabel, Input} from '@material-ui/core';

const Index=()=>{
return(
    <Grid container direction="row" justify="center" alignItems="center">
        <Grid item xs={6}>
<Grid container>
<Grid item xs={12}>
<Typography>Log In</Typography></Grid>
<Grid item xs={12}>
 <FormControl>
     <InputLabel htmlFor="my-input">Username</InputLabel>
     <Input required id="my-input"/>
     <InputLabel required htmlFor="my-input">Password</InputLabel>
     <Input id="my-input"/>
 </FormControl>
</Grid>
</Grid>
        </Grid>
        </Grid>
);
}
export default Index;
